import React, { useState } from 'react';

import AddUser from './components/Users/AddUsers';
import UsersList from './components/Users/UsersList';


function App() {
  const [usersList, setUsersList] = useState([]);

  return (
    <div>
      <AddUser onAddUser />
      <UsersList users={[usersList]} />
    </div>
  );
}

export default App;
